 To find out how many carrot sticks Matt needs to eat in order to have 5 cookies, we can set up an equation. Let's denote the number of carrot sticks as x. According to the problem, Matt can have half as many cookies as the number of carrot sticks, plus two extra cookies for cleaning his room. So, the number of cookies Matt can have is:

\begin{align*}
\text{Number of cookies} &= \frac{1}{2} \times \text{Number of carrot sticks} +2 \\
5 &= \frac{1}{2}x +2
\end{align*}

To solve for x, we first need to isolate x on one side of the equation. We can do this by subtracting 2 from both sides and then multiplying both sides by 2:

\begin{align*}
5-2 &= \frac{1}{2}x+2-2 \\
3 &= \frac{1}{2}x
\end{align*}

Now, we can solve for x by multiplying both sides by 2:

\begin{align*}
3 \times 2 &= \frac{1}{2}x \times 2 \\
6 &= x
\end{align*}

Therefore, Matt needs to eat 6 carrot sticks to have 5 cookies.

