Now let's calculate the revenue from each sale:

1. $50 for 40 sq.m: \frac{$50}{40 sq.m} = \boxed{$1.25 per sq.m}
2. $30 for 10 sq.m: \frac{$30}{10 sq.m} = \boxed{$3 per sq.m}
3. $99 for 30 sq.m: \frac{$99}{30 sq.m} = \boxed{$3.3 per sq.m}

Finally, let's calculate the total revenue Abraham earned from selling all his unused land:

Total revenue = (Revenue from first sale) + (Revenue from second sale) + (Revenue from third sale)
Total revenue = ($1.25 per sq.m * 40 sq.m) + ($3 per sq.m * 10 sq.m) + ($3 per sq.m * 30 sq.m)
